import { pastaArabiata } from "./dummy/mealdata";

const App = () => {
  return (
    <div>
      {pastaArabiata.meals.map((meal) => {
        const key = meal.strYoutube.split("=")[1];
        return (
          <div key={meal.idMeal}>
            <h1>{meal.strMeal}</h1>
            <h1>{meal.strCategory}</h1>
            <iframe
              width="420"
              height="315"
              src={`https://www.youtube.com/embed/${key}`}
            ></iframe>
            <img src={meal.strMealThumb} alt="" />
          </div>
        );
      })}
    </div>
  );
};
export default App;
